import React from "react";
import { Link } from "react-router-dom";
import "./Signup.css";

const Signup = () => {
  return (
    <div className="signup-wrapper">
      <div className="signup-form">
        <Link to="/login">Login</Link>
      </div>
    </div>
  );
};

export default Signup;
